import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import dummyPictures from '../../../dummyDate';

function Gallery() {
    console.log('dummyPictures : ', dummyPictures);

    const [temp, setTemp] = useState(false);
    const [forRenderingOne, setForRenderingOne] = useState(<></>);
    const [forRenderingTwo, setForRenderingTwo] = useState(<></>);
    const [forRenderingThree, setForRenderingThree] = useState(<></>);
    const [forRenderingFour, setForRenderingFour] = useState(<></>);


    // 애초에 4개씩 받아서 뿌릴 것

    function forFourMultiplyFour(_pictures) {
        for (let i = 0; i < 3; i++) {
            _pictures.push(dummyPictures.pictures[i]);
        }
        if(_pictures.length === 0){
            return <></>;
        }
        return <div
            style={{ display: 'flex' }}>{_pictures.map((el) => {
                return <p key={el.id}><img src={el} alt="picture"></img></p>
            })}</div>;
    }

    useEffect(() => {
        // 배열.slice해서 각 argument로 할당해줄 것
        setForRenderingOne(forFourMultiplyFour(dummyPictures.pictures.slice()));
        setForRenderingTwo(forFourMultiplyFour(dummyPictures.pictures.slice()));
        setForRenderingThree(forFourMultiplyFour(dummyPictures.pictures.slice()));
        setForRenderingFour(forFourMultiplyFour(dummyPictures.pictures.slice()));
    }, [temp])
    return (
        <div style={{ textAlign: 'center' }}>
            <div>
                { }
            </div>
        </div>
    )
}

export default Gallery

const Img = styled.img`
    width: 50vw;
`

